import styled from 'styled-components';

const DropDownContainer = styled("div")``;
const DropDownHeader = styled("div")``;
const DropDownListContainer = styled("div")``;
const DropDownList = styled("ul")``;
const ListItem = styled("li")``;
export default function NavbarAdmin(){
    return(
        <>
        <div id="nav-admin" style={{display:'flex',justifyContent:"space-between",marginLeft:87,height:120}}>
            <img style={{width:167,height:64,marginTop:34}} src = { require('../assets/Group 4.png').default }/> 
            <DropDownContainer>
        <DropDownHeader>Mangoes</DropDownHeader>
        <DropDownListContainer>
          <DropDownList>
            <ListItem>Mangoes</ListItem>
            <ListItem>Apples</ListItem>
            <ListItem>Oranges</ListItem>
          </DropDownList>
        </DropDownListContainer>
      </DropDownContainer>
        </div>
        </>
    )
}
